import { Button, Typography } from '@mui/material'
import { Box } from '@mui/material'
import React from 'react'

const HeroBanner = () => {
  return (
    <Box sx={{
        mt:{lg:'212px',x5:'70px'},
        ml:{sm:'50px'}
    }} position='relative' p="20px">
        <Typography color="Darkblue" fontWeight="600" fontsize="26px">
        Fitness for Every Body
        </Typography>
        <Typography fontWeight={500} sx={{fontSize:{lg:'44px',xs:'40px'}}}>
        The Path to a Better You,<br/> Starts Here  
        </Typography>
        <Typography fontSize="22px" lineHeight={"35px"}>
            Explore Fitness 
        </Typography>
        <Button variant='contained'color='Darkblue'>Regiter</Button>
    </Box>
  )
}

export default HeroBanner
